import logo from './logo.svg';
import './App.css';
import SearchCritera from './Component/SearchCriteria';
import React from 'react';

function App() {

  function fetchAPIHandler(){
    fetch('https://localhost:7195/api/SearchCriteria/GetCriteria')
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            employees: result
          });
        }
      );
    }

  return (
   <React.Fragment>
     <SearchCritera></SearchCritera>
   </React.Fragment>

  );
}

export default App;
